import React, { Component } from 'react';
import SocialMediaIcons from 'react-social-media-icons';

const socialMediaIcons = [
  {
    url: 'https://github.com/andrewgbliss',
    className: 'fa-github-square',
  },
  {
    url: 'https://gitlab.com/andrewgbliss',
    className: 'fa-gitlab',
  },
  {
    url: 'https://www.npmjs.com/~andrewgbliss',
    className: 'fa-npm',
  },
];

class Footer extends Component {
    render() {
        return (
            <footer>
            <div className="container clearfix">
              <div className="col" id="col-1">
                <ul>
                  <li><a href="/">Home</a></li>
                </ul>
              </div>
              <div className="col" id="col-2">
              <ul>
                  <li><a href="/Services">Services</a></li>
                </ul>
              </div>
              <div className="col" id="col-3">
                <ul>
                  <li><a href="/ContactUs">Contact Us</a></li>
                </ul>
              </div>
              <div className="col" id="col-4">
                <ul>
                  <li><a href="/AboutUs">About Us</a></li>
                </ul>
              </div>
              <div>
                  <SocialMediaIcons
                    icons={socialMediaIcons}
                    iconSize={'1.3em'}
                    iconColor={'#495056'}
                  />
              </div>
              <div id="copy">
                &#xa9; Designed and built by Team Atepex 2019
              </div>
            </div>
          </footer>
        );
    }
}

export default Footer;
